import React from "react";
import { Form } from "react-bootstrap";

const Footer = () => {
  return (
    <div style={{ backgroundColor:" #fbd062"}} className="row d-flex">
      <div className="col-md-6 col-sm-12"></div>
      <div className="col-sm-12 col-md-6">
        <Form.Control
                         style={{width:"630px", height:"70px"}}

          type="text"
          id="inputPassword5"
          aria-describedby="passwordHelpBlock"
        />
        <Form.Control
                 style={{width:"630px", height:"70px"}}

          type="text"
          id="inputPassword5"
          aria-describedby="passwordHelpBlock"
        />
        <Form.Control
         style={{width:"630px", height:"277px"}}
          type="text"
          id="inputPassword5"
          aria-describedby="passwordHelpBlock"
        />
      </div>
    </div>
  );
};

export default Footer;
